# The lower triangular array computed by _F. Chapoton_'s formula:
from math import comb as binomial
def T(n: int, k: int) -> int:
    if k < 0:  return 0
    if k == 0: return 1
    if k == 1: return n
    return (binomial(n + 2*k, k - 2) * (n**2 + 3*n - 2*k + 2)) // (k * (k - 1))
for n in range(9): print([T(n, k) for k in range(n+1)])  # _Peter Luschny_, Sep 06 2025

